import React from 'react';
import { NavLink, useLocation } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPaintBrush } from '@fortawesome/free-solid-svg-icons';

export function Nav() {
  return (
    <nav>
      <ul role="menubar">
        <li role="tab"> <NavLink exact to='/gallery' activeClassName="active-tab"><FontAwesomeIcon icon={faPaintBrush} /> Gallery</NavLink> </li>
        <li role="tab"> <NavLink exact to='/sellers' activeClassName="active-tab"><FontAwesomeIcon icon={faPaintBrush} /> Sellers</NavLink> </li>
        <li role="tab"> <NavLink exact to="/profile" activeClassName="active-tab"><FontAwesomeIcon icon="fa-thin fa-user" /> Profile</NavLink> </li>
        <li role="tab"> <NavLink exact to='/liked' activeClassName="active-tab"><FontAwesomeIcon icon={faPaintBrush} /> Liked</NavLink></li>
      </ul>
    </nav>
  );
}
